  return (
    <div >
     <ul className="nav nav-tabs">
        {tabs.map((tab, index) => (
          <li className="nav-item" key={index}>
            <a
              className={`nav-link ${activeTab === index ? 'active' : ''}`}
              href="#"
              onClick={() => setActiveTab(index)}
            >
              {tab.title}
            </a>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default App;
